import React from "react";

const Sresult = (props) => {
  const img = props.name;
  const name = `https://source.unsplash.com/1600x900/?${img}`;
  console.log(name);
  return (
    <>
      <div>
        <img src={name} alt="tp" />
        {console.log(name)}
      </div>
    </>
  );
};

export default Sresult;
